    let query = `select * from patient_master where patient_id = ${this.patient_id};`;
    this.db.processQuery(query).subscribe(patient_master => {
      if (patient_master.length === 0) {
        window.alert('invalid');
      } else {
        // console.log(patient_master);
        this.patient_master = patient_master; // console.log(this.patient_master);      
      }
    });
  }

  dup_getPatientInformation() {
    let query = `select * from patient_master where patient_id = ${this.patient_id};`;
